import React, { useState } from 'react';
import './Signup.css'
import { Link } from 'react-router-dom'
import axios from 'axios'

const Signup = () => {
  const [user, setUser] = useState({
    fullName: "",
    username: "",
    Password: "",
    confirmPassword: "",
    gender: ""
  })
  const handleGender = async (gender) => {
    setUser({ ...user, gender })
  }
  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const res = await axios.post("http://localhost:8002/api/signup", user, {
        headers: {
          "Content-Type": "application/json"
        },
        withCredentials: true
      })
      console.log("Response is ", res)
    } catch (error) {
      console.log("Error in signup commponent", error)
    }
    // console.log("User is",user)
    setUser({
      fullName:"",
    username:"",
    Password:"",
    confirmPassword:"",
    gender:""
    })
  }
  return (
    <div className='w-full max-w-md p-6 rounded-lg shadow-md bg-gray-800 bg-opacity-75'>
      <h1 className='text-3xl font-bold text-center text-white'>Signup</h1>
      <form onSubmit={handleSubmit} action="">
        <div className='mb-4'>
          <label className='block text-white'>
            <span className='text-base'>Full Name</span>
            <input
              className='mt-1 w-full p-2 rounded-md bg-gray-200'
              type='text'
              placeholder='Hardik'
              value={user.fullName}
              onChange={(e) => { setUser({ ...user, fullName: e.target.value }) }}
            />
          </label>
        </div>
        <div className='mb-4'>
          <label className='block text-white'>
            <span className='text-base'>Username</span>
            <input
              className='mt-1 w-full p-2 rounded-md bg-gray-200'
              type='text'
              placeholder='Username'
              value={user.username}
              onChange={(e) => { setUser({ ...user, username: e.target.value }) }}

            />
          </label>
        </div>
        <div className='mb-4'>
          <label className='block text-white'>
            <span className='text-base'>Password</span>
            <input
              className='mt-1 w-full p-2 rounded-md bg-gray-200'
              type='password'
              placeholder='Password'
              value={user.Password}
              onChange={(e) => { setUser({ ...user, Password: e.target.value }) }}

            />
          </label>
        </div>
        <div className='mb-4'>
          <label className='block text-white'>
            <span className='text-base'>Confirm Password</span>
            <input
              className='mt-1 w-full p-2 rounded-md bg-gray-200'
              type='password'
              placeholder='Confirm Password'
              value={user.confirmPassword}
              onChange={(e) => { setUser({ ...user, confirmPassword: e.target.value }) }}

            />
          </label>
        </div>
        <div className='flex items-center justify-between'>
          <label className='flex items-center text-white'>
            <input type="checkbox"
              checked={user.gender === "male"}
              onChange={() => { handleGender("male") }}
              defaultChecked
              className="checkbox mx-2" />
            <span className='ml-2'>Male</span>

          </label>
          <label className='flex items-center text-white'>
            <input type="checkbox"
              checked={user.gender === "female"}
              onChange={() => { handleGender("female") }}
              defaultChecked
              className="checkbox mx-2" />
            <span className='ml-2'>Female</span>

          </label>
          <Link to='/login'>
            Already have an account
          </Link>
        </div>
        <div>
          <button type='submit' className='btn btn-block btn-sm mt-2 border border-slate-700'>Signup</button>
        </div>
      </form>
    </div>
  );
}

export default Signup;
